CREATE DATABASE IF NOT EXISTS projectdb;
use projectdb;

Create TABLE IF NOT EXISTS VerifiedUser
(
    UserId VARCHAR(100) PRIMARY KEY,
    FirstName VARCHAR(100),
    LastName VARCHAR(100),
    WinPercntage  FLOAT,
    UserPassword VARCHAR(100)
);


