#######################################################################################################################################################################################################################3

CREATE TABLE Team(
   TeamID     INTEGER  NOT NULL PRIMARY KEY ,
   TeamName   VARCHAR(100) NOT NULL,
   SpreadOdds INTEGER  NOT NULL
);


#################################################################################################

CREATE TABLE Game(
   GameId   INTEGER  NOT NULL PRIMARY KEY
  ,GameTime DATE  NOT NULL
  ,Country  VARCHAR(100) NOT NULL
  ,City     VARCHAR(100) NOT NULL
);
#############################################################################################3

/*
CREATE TABLE PlaysIn(
   GameID      INTEGER  NOT NULL PRIMARY KEY
  ,PlaysInName INTEGER  NOT NULL
  ,Sport       VARCHAR(23) NOT NULL
  ,League      VARCHAR(22) NOT NULL
);
 */

Create TABLE IF NOT EXISTS PlaysIn
(
    GameID INTEGER,
    PlaysInName INTEGER,
    Sport VARCHAR(100),
    League VARCHAR(200),
    CONSTRAINT playInsPK PRIMARY KEY (GameID, PlaysInName),
    CONSTRAINT fk_01 FOREIGN KEY (GameID)
        REFERENCES Game(GameId)
        ON UPDATE cascade
        ON DELETE cascade,
    CONSTRAINT fk_02 FOREIGN KEY (PlaysInName)
        REFERENCES Team(TeamID)
        ON UPDATE cascade
        ON DELETE cascade
);

######################################################################################################

Create TABLE IF NOT EXISTS VerifiedUserEmail
(
    UserID VARCHAR(100),
    Email VARCHAR(200),
    CONSTRAINT VUEPK PRIMARY KEY (UserID, Email),
    CONSTRAINT fk_03 FOREIGN KEY (UserID)
        REFERENCES VerifiedUser(UserId)
        ON UPDATE cascade
        ON DELETE cascade
);


Create TABLE IF NOT EXISTS NormalUserEmail
(
    UserID VARCHAR(100),
    Email VARCHAR(200),
    CONSTRAINT NUEPK PRIMARY KEY (UserID, Email),
    CONSTRAINT fk_04 FOREIGN KEY (UserID)
        REFERENCES NormalUser(UserId)
        ON UPDATE cascade
        ON DELETE cascade
);



Create TABLE IF NOT EXISTS Post
(
    UserID VARCHAR(100),
    PostID INTEGER,
    Content TEXT,
    LikeCount INTEGER,
    DislikeCount INTEGER,
    PostTime DATETIME,
    GameID INTEGER,
    CONSTRAINT PostPK PRIMARY KEY (UserID, PostID),
    CONSTRAINT fk_07 FOREIGN KEY (UserID)
        REFERENCES VerifiedUser(UserId)
        ON UPDATE cascade
        ON DELETE cascade,
    CONSTRAINT fk_07_1 FOREIGN KEY (GameID)
        REFERENCES Game(GameId)
        ON UPDATE cascade
        ON DELETE cascade

);


Create TABLE IF NOT EXISTS Reaction
(
    UserID VARCHAR(100),
    ReactionID INTEGER,
    ReactionTime DATETIME,
    ReactionLike Boolean,
    ReactionDislike BOOLEAN,
    PostUserID VARCHAR(100),
    PostID INTEGER,
    CONSTRAINT ReactionPK PRIMARY KEY (UserID, ReactionID),
    CONSTRAINT fk_08 FOREIGN KEY (UserID)
        REFERENCES NormalUser(UserId)
        ON UPDATE cascade
        ON DELETE cascade,
    CONSTRAINT fk_09 FOREIGN KEY (PostUserID, PostID)
        REFERENCES Post(UserID, PostID)
        ON UPDATE cascade
        ON DELETE cascade
#     CONSTRAINT fk_10 FOREIGN KEY (PostID)
#         REFERENCES Post(PostID)
#         ON UPDATE cascade
#         ON DELETE cascade
);





/*
CREATE TABLE Comment(
   UserID      VARCHAR(100) NOT NULL PRIMARY KEY
  ,ReactionID  INTEGER  NOT NULL
  ,CommentText VARCHAR(500) NOT NULL
);

 */

Create TABLE IF NOT EXISTS Comment
(
    UserID     VARCHAR(100),
    ReactionID INTEGER,
    CommentText    VARCHAR(500),
    CONSTRAINT CMPK PRIMARY KEY (UserID, ReactionID, CommentText),
    CONSTRAINT fk_05 FOREIGN KEY (UserID, ReactionID)
        REFERENCES Reaction(UserID, ReactionID)
        ON DELETE Cascade
);


Create TABLE IF NOT EXISTS Discipline
(
    AdminID INTEGER,
    CaseID INTEGER,
    Message VARCHAR(2000),
    Type VARCHAR(200),
    DisciplineDate DATE,
    ReactionID INTEGER,
    UserID VARCHAR(100),
    PostUserID VARCHAR(100),
    PostID INTEGER,
    CONSTRAINT DisciplinePK PRIMARY KEY (AdminID, CaseID),
    CONSTRAINT fk_11 FOREIGN KEY (AdminID)
        REFERENCES SystemAdmin(AdminId)
        ON UPDATE cascade
        ON DELETE cascade,
    CONSTRAINT fk_13 FOREIGN KEY (UserID)
        REFERENCES Reaction(UserId)
        ON UPDATE cascade
        ON DELETE cascade,
    CONSTRAINT fk_14 FOREIGN KEY (PostUserID, PostID)
        REFERENCES Post(UserId, PostID)
        ON UPDATE cascade
        ON DELETE cascade
);


Create TABLE IF NOT EXISTS TeamProps
(
    TeamID INTEGER,
    TeamProps INTEGER,
    PropName VARCHAR(1000),
    CONSTRAINT TPPK PRIMARY KEY (TeamID, TeamProps),
    CONSTRAINT fk_16 FOREIGN KEY (TeamID)
        REFERENCES Team(TeamID)
        ON UPDATE cascade
        ON DELETE cascade
);



Create TABLE IF NOT EXISTS PlayerProps
(
    PlayerName VARCHAR(200),
    TeamID INTEGER,
    PlayerProps INTEGER,
    PropName VARCHAR(300),
    CONSTRAINT PPPK PRIMARY KEY (PlayerName),
    CONSTRAINT fk_17 FOREIGN KEY (TeamID)
        REFERENCES Team(TeamID)
        ON UPDATE cascade
        ON DELETE cascade
);

